    true,nt"url": null,nt"notes": "<p>The Online Tuberculosis Information System
    (OTIS) on CDC WONDER contains information on verified tuberculosis (TB) cases reported
    to the Centers for Disease Control and Prevention (CDC) by state health departments,
    the District of Columbia and Puerto Rico since 1993. These data were extracted from
    the CDC national TB surveillance system. OTIS reports case counts, incidence rates,
    population counts, percentage of cases that completed therapy within 1 year of diagnosis,
    and percentage of cases tested for drug susceptibility. Data for 22 variables are
    included in the data set, including: age groups, race / ethnicity, sex, vital status,
    year reported, state, metropolitan area, several patient risk factors, directly
    observed therapy, disease verification criteria and multi-drug resistant TB. Each
    year these data are updated with an additional year of cases plus revisions to cases
    reported in previous years. OTIS is produced by the U.S. Department of Health and
    Human Services, Public Health Service, Centers for Disease Control and Prevention
    (CDC), National Center for HIV/AIDS, viral Hepatitis, STD and TB Prevention (NCHHSTP).</p>n",nt"license_title":
